import React, { useState } from 'react';
import Sidebar from './componentes-comunes/Sidebar';
import SidebarAdminData from './administrador/data/SidebarAdminData';
import './recursos/estilos/SidebarGlobal.css'; // Estilos del Sidebar
import './recursos/estilos/global.css'; // Estilos globales

const App = () => {
    const [isCollapsed, setIsCollapsed] = useState(false);

    const toggleSidebar = () => {
        setIsCollapsed(!isCollapsed);
    };

    return (
        <div className="app-container">
            {/* Sidebar usando datos del administrador */}
            <Sidebar
                sidebarData={SidebarAdminData}
                isCollapsed={isCollapsed}
                toggleSidebar={toggleSidebar}
            />
            <div className={`main-content ${isCollapsed ? 'collapsed' : ''}`}>
                <h1>Bienvenido, Administrador</h1>
                {/* Aquí se pueden incluir más componentes o rutas */}
            </div>
        </div>
    );
};

export default App;
